import React, { useState } from 'react'

const Cart = ({cart}) => {

  const [state , setState] = useState([cart])
  return (
    <div>
      <h2>Cart</h2>
      <div>{state.map((data)=>{
        return(
          <>
            <div>{data.id}</div>
            <img src={data.thumbnail} alt="" />
          </>
        )
      })}</div>
    </div>
  )
}

export default Cart
